import { useState } from "react";
import {
  Button,
  Chip,
  Grid,
  IconButton,
  InputAdornment,
  makeStyles,
  Paper,
  TextField,
  Typography,
  Modal,
  Slider,
  FormControlLabel,
  MenuItem,
  Checkbox,
} from "@material-ui/core";
import Rating from "@material-ui/lab/Rating";
import SearchIcon from "@material-ui/icons/Search";
import FilterListIcon from "@material-ui/icons/FilterList";
import ArrowUpwardIcon from "@material-ui/icons/ArrowUpward";
import ArrowDownwardIcon from "@material-ui/icons/ArrowDownward";

import { userType } from "../lib/isAuth";

const useStyles = makeStyles(() => ({
  body: {
    height: "inherit",
  },
  button: {
    width: "100%",
    height: "100%",
  },
  jobTileOuter: {
    padding: "30px",
    margin: "20px 0",
    boxSizing: "border-box",
    width: "100%",
  },
  popupDialog: {
    height: "100%",
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
  },
}));

const JobTile = () => {
  const classes = useStyles();
  const deadline = new Date('2023-11-10').toLocaleDateString();
  return (
    <Paper className={classes.jobTileOuter} elevation={3}>
      <Grid container>
        <Grid container item xs={12} sm={9} spacing={1} direction="column">
          <Grid item>
            <Typography variant="h5">{'Software Engineer'}</Typography>
          </Grid>
          <Grid item>
            <Rating value={5} readOnly />
          </Grid>
          <Grid item>Role : {'Junior Software Engineer'}</Grid>
          <Grid item>Salary : &#36;{'1000'} per month</Grid>
          <Grid item>
            Duration :{"1 month"}
          </Grid>
          <Grid item>Posted By : {'Putri'}</Grid>
          <Grid item>Application Deadline : {deadline}</Grid>

          <Grid item>
              <Chip label={'React'} style={{ marginRight: "2px" }} />
              <Chip label={'Node Js'} style={{ marginRight: "2px" }} />
          </Grid>
        </Grid>
        <Grid item xs={12} sm={3} container direction="column" justify="flex-end" alignItems="flex-end">
          <Button
            variant="contained"
            color="primary"
            className={classes.button}
            style={{ width: '100px', height: '30px', fontSize: '14px' }}
            disabled={userType() === "recruiter"}
          >
            Apply
          </Button>
        </Grid>
      </Grid>
    </Paper>
  );
};

const FilterPopup = (props) => {
  const classes = useStyles();
  const { open, handleClose, searchOptions, setSearchOptions, getData } = props;
  // Kode modal dan komponen filter dapat dipertahankan sesuai kebutuhan.
};

const Home = () => {
  const [filterOpen, setFilterOpen] = useState(false);
  const [searchOptions, setSearchOptions] = useState({
    query: "",
    jobType: {
      fullTime: false,
      partTime: false,
      wfh: false,
    },
    salary: [0, 100],
    duration: "0",
    sort: {
      salary: {
        status: false,
        desc: false,
      },
      duration: {
        status: false,
        desc: false,
      },
      rating: {
        status: false,
        desc: false,
      },
    },
  });

  return (
    <>
      <Grid container direction="column" alignItems="center" style={{ padding: "30px", minHeight: "93vh" }}>
        <Grid container item xs={12} sm={10} md={8} lg={6} direction="column" alignItems="center">
          <Grid item xs>
            <Typography variant="h6" style={{ color: "white", fontWeight: "bold", fontFamily: 'Nunito Sans, sans-serif' }}>
              Find The Most Interesting Work Position Here
            </Typography>
          </Grid>
          <Grid item xs>
            <TextField
              label="Search Jobs"
              value={searchOptions.query}
              onChange={(event) =>
                setSearchOptions({
                  ...searchOptions,
                  query: event.target.value,
                })
              }
              InputProps={{
                endAdornment: (
                  <InputAdornment position="end">
                    <IconButton>
                      <SearchIcon />
                    </IconButton>
                  </InputAdornment>
                ),
              }}
              style={{ width: "100%", maxWidth: "500px", backgroundColor: "white", borderRadius: "12px" }}
              variant="outlined"
            />
          </Grid>
          <Grid item>
            <IconButton onClick={() => setFilterOpen(true)}>
              <FilterListIcon />
            </IconButton>
          </Grid>
        </Grid>

        <Grid container item xs={12} spacing={2} justify="center">
          <Grid item xs={12} sm={6} md={4}>
            <JobTile />
          </Grid>
          {/* Tambahkan lebih banyak komponen JobTile di sini sesuai dengan kebutuhan */}
        </Grid>
      </Grid>
      <FilterPopup
        open={filterOpen}
        searchOptions={searchOptions}
        setSearchOptions={setSearchOptions}
        handleClose={() => setFilterOpen(false)}
      />
    </>
  );
};

export default Home;
